"use strict";app.factory("highscoreService",["$http",function(n){let t={};return t.get=function(t,i){n.get("/api/highscores").then(n=>t(n.data),n=>i("Error while reading the highscores: "+n.data.Message))},t.put=function(t,i){n.post("/api/highscores",t).then(()=>i(),n=>error("Error while saving the highscores: "+n.data.Message))},t}]);